import React, { useState, useEffect } from "react";
//import axios from "axios";

import TableFilters from "../../components/QueryView/TableFilters/TableFilters";
import DynamicTable from "../../components/QueryView/DynamicTable/DynamicTable";
type Props = {};

const Services: React.FC<Props> = ({}) => {
  const filterElements = [
    { name: "id", type: "text", placeholder: "Id" },
    {
      name: "numero_documento",
      type: "text",
      placeholder: "Numero de documento",
    },
    {
      name: "primer_nombre",
      type: "text",
      placeholder: "Primer nombre",
      upCase: true,
    },
    {
      name: "primer_apellido",
      type: "text",
      placeholder: "Primer apellido",
      upCase: true,
    },
    {
      name: "fecha_inicio",
      type: "date",
      placeholder: "Fecha inicio",
    },
    {
      name: "fecha_fin",
      type: "date",
      placeholder: "Fecha fin",
      value: "1990-12-12",
    },
    {
      name: "estado",
      type: "select",
      placeholder: "Estado",
      items: [
        { key: "1", value: "Pendiente" },
        { key: "2", value: "Aprobado" },
        { key: "3", value: "Rechazado" },
      ],
      selectedItemKey: "",
    },
    {
      name: "tipo",
      type: "select",
      placeholder: "Tipo",
      items: [
        { key: "1", value: "Medico" },
        { key: "2", value: "Enfermera" },
        { key: "3", value: "Jefe" },
      ],
      selectedItemKey: "",
    },
    {
      name: "submit_btn",
      type: "submit",
      placeholder: "Buscar",
      value: "Buscar",
      classes: ["btn", "btn-primary"],
    },
    {
      name: "submit_btn",
      type: "submit",
      placeholder: "Buscar",
      value: "Exportar V1",
      classes: ["btn", "btn-warning"],
    },
    {
      name: "submit_btn",
      type: "submit",
      placeholder: "Buscar",
      value: "Exportar V2",
      classes: ["btn", "btn-warning"],
    },
  ];
  let tableHeaders = [
    "Id",
    "Estado",
    "Tipo",
    "Categoria",
    "Empresa Asignada",
    "Solicitante",
    "Fecha",
  ];
  let data = [
    {
      id: 1,
      contents: [
        "10",
        "Aprobado",
        "Multiple",
        "Experimental",
        "Microsoft",
        "Edward Collen",
        "2020/12/12",
      ],
      actions: ["edit", "aprobe", "delete"],
    },
    {
      id: 2,
      contents: [
        "10",
        "Aprobado",
        "Multiple",
        "Experimental",
        "Microsoft",
        "Edward Collen",
        "2020/12/12",
      ],
      actions: ["edit", "aprobe", "delete"],
    },
    {
      id: 3,
      contents: [
        "10",
        "Aprobado",
        "Multiple",
        "Experimental",
        "Microsoft",
        "Edward Collen",
        "2020/12/12",
      ],
      actions: ["edit", "delete"],
    },
  ];
  const actions = {
    edit: {
      theClass: "btn btn-primary",
      label: "Editar",
    },
    aprobe: {
      theClass: "btn btn-warning",
      label: "Aprobar",
    },
    delete: {
      theClass: "btn btn-danger",
      label: "Borrar",
    },
  };

  let actionTriggered = (id: number, action: string) => {
    alert(`number:${id}, action:${action}`);
  };

  const [loading, setLoading] = useState(false);

  useEffect(() => {
    alert("sdfsd");
  }, []);

  useEffect(() => {
    setLoading(true);
    const fetchData = async () => {
      const result = await axios(
        "https://hn.algolia.com/api/v1/search?query=redux"
      );
    };
    fetchData();
  }, []);

  return (
    <>
      <div className="container-fluid">
        <h1>
          Consulta <small>Servicios</small>
        </h1>
        <div className="row">
          <TableFilters elements={filterElements} />
          <div className="col-10">
            <div className="container-fluid">
              <div className="table-responsive">
                <DynamicTable
                  headers={tableHeaders}
                  data={data}
                  actions={actions}
                  actionTriggered={actionTriggered}
                />
              </div>
            </div>

            <div className="container">
              <div>TablePaginator</div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
